offline_help_desc:
Tilsluttet og tændt;
Wi-Fi er aktiveret og tilsluttet;
Wi-Fi-adgangskoden er ikke blevet ændret for nylig.

problem_content_answer_ess_01:
Mulig årsag 
 Enhedens interne softwareversion stemmer ikke overens; 
 Sådan håndterer du 
 Kontakt tjenesteudbyderen for at opgradere igen;

problem_content_answer_ess_02:
Mulig årsag 
 1. Den fotovoltaiske streng kortslutter den beskyttende jord; 
 2. Installationsmiljøet for de fotovoltaiske strenge er relativt fugtigt; 
 3. Batteriporten er kortsluttet til den beskyttende jord; 
 Sådan håndteres 
 1. Genstart enheden. Hvis fejlen forsvinder, kan du fortsætte med at bruge den; 
 2. Hvis fejlen opstår eller ikke forsvinder mange gange i træk, bedes du kontakte tjenesteudbyderen;

problem_content_answer_ess_03:
Mulig årsag 
 Antallet af strenge i serie er for stort, og tomgangsspændingen er større end den maksimale specifikation for indgangsspænding; 
 Sådan håndteres 
 Kontakt venligst tjenesteudbyderen;

problem_content_answer_ess_04:
Mulig årsag 
 Strengens positive og negative poler er byttet om; 
 Sådan håndteres 
 Kontakt venligst tjenesteudbyderen;

problem_content_answer_ess_05:
Mulig årsag 
 Faserækkefølgen i trefaset elnettet er unormal; 
 Sådan håndteres det 
 Kontakt venligst tjenesteudbyderen;

problem_content_answer_ess_06:
Mulig årsag 
 Trefaset udstyr, trefaset netspænding mangler en eller to faser; 
 Sådan håndteres 
 Kontakt venligst tjenesteudbyderen;

problem_content_answer_ess_07:
Mulig årsag 
 Dårlig kontakt i målerens kommunikationslinje; 

 Sådan håndteres 
 1. Kontroller, om der er løshed i begge ender af kommunikationslinjen; 
 2. Hvis ledningsføringen er normal, og fejlen altid har eksisteret, bedes du kontakte serviceudbyderen;

problem_content_answer_ess_08:
Mulig årsag 
 Trefaset udstyr, dieselgenererende spænding mangler en eller to faser; 

 Sådan håndteres 
 Kontakt venligst tjenesteudbyderen;

problem_content_answer_ess_09:
Mulig årsag 
 Unormal fasesekvens i dieselgenerator; 

 Sådan håndteres det 
 Kontakt venligst serviceudbyderen;

problem_content_answer_ess_10:
Mulig årsag 
 Net og Backup er byttet om; 

 Sådan håndteres 
 Når strømmen er slukket, skal net- og backup-terminalerne justeres;

problem_content_answer_ess_11:
Mulig årsag 
 Inden for kort tid har udstyret lidt af flere alvorlige fejl i træk; 

 Sådan håndterer du 
 Kontakt tjenesteudbyderen for at låse den op;

problem_content_answer_ess_12:
Mulig årsag 
 Batterimodulet er frakoblet PCS'en; 

 Sådan håndteres 
 1. Kontroller, at batteriet er tilsluttet PCS'en. Hvis det ikke er tilsluttet, skal du tilslutte det efter strømmen er slukket; 
 2. Kontroller, om batterimodulet er defekt. Hvis der er en fejl, bedes du kontakte serviceudbyderen for at løse den;

problem_content_answer_ess_15:
Mulig årsag 
 Lækagedetekteringskredsløbet er unormalt; 

 Sådan håndteres 
 1. Genstart enheden, og kontroller, om fejlen er løst; 
 2. Hvis det opstår ofte, eller det ikke kan afhjælpes i længere tid, skal du kontakte serviceudbyderen;

problem_content_answer_ess_16:
Mulig årsag 
 Enhedens interne kommunikation er unormal; 

 Sådan håndteres 
 1. Genstart enheden, og kontroller, om fejlen er løst; 
 2. Hvis fejlen opstår mange gange i træk eller ikke forsvinder, skal du kontakte serviceudbyderen;

problem_content_answer_ess_17:
Mulig årsag 
 Der er en fejl inde i batterimodulet; 

 Sådan håndteres 
 1. Genstart batterimodulet, fejlen forsvinder, og du kan fortsætte med at bruge det; 
 2. Hvis genstart stadig mislykkes, eller hvis fejlen opstår ofte, skal du kontakte serviceudbyderen;
